'b2evo: The other blog tool!' => 'b2evo: Das etwas andere Blog-Tool!',
"<p>This blog platform is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about this site.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the menu instead.</p>\n\n<p>If needed, skins can format info pages differently from regular posts.</p>" => "</p>Diese Blog-Plattform wird mit b2evolution betrieben.</p>\n\n</p>Sie sehen gerade eine Info-Seite für diese Seite.</p>\n\nInfoseiten sind normalen Einträgen sehr ähnlich, mit dem Unterschied, dass sie nicht zwischen normalen Einträgen angezeigt wird. Stattdessen tauchen sie als Info-Seiten im Menü auf.</p>\n\n</p>Falls benötigt, können Skins Infoseiten anders als reguläre Einträge formatieren.</p>",
'About this site' => 'Über diese Seite',
"<p>This is the Home page of this site.</p>\n\n<p>More specifically it is the \"Front page\" of the first collection of this site. This first collection is called \"Home\". Other sample collections have been created. You can access them by clicking \"Blog A\", \"Blog B\", \"Photos\", etc. in the menu bar at the top of this page.</p>\n\n<p>You can add collections at will. You can also remove them (including this \"Home\" collection) if you don't need one.</p>" => "<p>Dies ist die Homepage dieser Seite.</p>\n\n<p>Genauer gesagt ist es die \"Startseite\" der ersten Sammlung dieser Seite. Diese erste Sammlung wird \"Home\" genannt. Es wurden noch andere Beispielsammlungen erstellt. Sie können auf diese zugreifen, indem Sie auf \"Blog A\", \"Blog B\", \"Fotos\" etc. in der Menüleiste am oberen Ende dieser Seite klicken.</p>\n\n<p>Sie können Sammlungen nach Lust und Laune hinzufügen. Sie können Sie auch entfernen (einschließlich der \"Home\" Sammlung), wenn Sie keine benötigen.</p>",
'Homepage post' => 'Homepage-Eintrag',
'Main Intro post' => 'Haupt-Intro-Eintrag',
'This is the main intro post. It appears on the homepage only.' => 'Das ist der Haupt-Intro-Eintrag. Er erscheint nur auf der Homepage.',
"<p>This is the first post.</p>\n\n<p>It appears in a single category.</p>" => "<p>Das ist der erste Eintrag.</p>\n\n<p>Er erscheint in einer einzelnen Kategorie.</p>",
'First Post' => 'Erster Eintrag',
"<p>This is the second post.</p>\n\n<p>It appears in multiple categories.</p>" => "<p>Das ist der zweite Eintrag.</p>\n\n<p>Er erscheint in mehreren Kategorien.</p>",
'Second post' => 'Zweiter Eintrag',
