'Blog A' => 'Blog A',
"<p>This is page 1 of a multipage post.</p>\n\n<blockquote><p>This is a Block Quote.</p></blockquote>\n\n<p>You can see the other pages by clicking on the links below the text.</p>" => "<p>Dies ist Seite 1 eines mehrseitigen Eintrags.<p>\n\n<blockquote><p>Dies ist ein Blockzitat.</p></blockquote>\n\n<p>Sie können die anderen Seiten sehen, indem Sie auf die Links unter dem Text klicken.<p>",
'This is a multipage post' => 'Dies ist ein mehrseitiger Eintrag',
