'<p>It is the last page.</p>' => '<p>Dies ist die letzte Seite.<p>',
'<p>This is an extended post with no teaser. This means that you won\'t see this teaser any more when you click the "more" link.</p>' => '<p>Dies ist ein erweiterter Eintrag ohne Teaser. Das bedeutet, dass Sie diesen Teaser nicht mehr sehen werden, wenn Sie auf den Link "mehr" klicken.<p>',
'Extended post with no teaser' => 'Erweiterter Eintrag ohne Teaser',
'<p>This is the extended text. You only see it when you have clicked the "more" link.</p>' => '<p>Dies ist ein erweiterter Text. Sie sehen diesen nur, wenn Sie auf den Link "mehr" geklickt haben.<p>',
'<p>This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.</p>' => '<p>Dies ist ein erweiterter Eintrag. Das bedeutet, dass Sie standardmäßig nur diesen kleinen Teaser sehen. Um mehr zu sehen, müssen Sie auf den Link unten klicken.<p>',
'Extended post' => 'Erweiterter Eintrag',
'<p>This post has a special post type called "Post with custom fields".</p>' => '<p>Dieser Eintrag hat einen bestimmten Eintragstypen namens "Eintrag mit benutzerdefinierten Feldern."</p>',
'Custom Fields Example' => 'Beispiel für angepasste Felder',
'<p>This post type defines 4 custom fields.</p>' => '<p>Dieser Eintragstyp definiert 4 benutzerdefinierte Felder.</p>',
'<p>This post has sample values for these for 4 fields. You can see them below</p>' => '<p>Dieser Eintrag hat Beispielwerte für diese für 4 Felder. SIe können sie unten sehen</p>',
'<p>This post has a special post type called "Child Post".</p>' => '<p>Dieser Eintrag hat einen bestimmten Eintragstypen namens "Child-Eintrag".</p>',
'Child Post Example' => 'Beispiel eines Child-Eintrags',
"<p>This post has several images attached to it. Each one uses a different Attachment Position. Each may be displayed differently depending on the skin they are viewed in.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>An diesen Eintrag sind mehrere Bilder angehängt. Jedes Bild verwendet eine anderen Anhangsposition und wird möglicherweise unterschiedlich angezeigt, je nachdem mit welchem Skin es angesehen wird.</p>\n\n<p>Sehen Sie sich den Foto-Blog an (über die Links oben zugänglich), um ein komplett anderen Skin anzuschauen, der eher auf Fotos als auf Blog-Text ausgerichtet ist.</p>",
'Image post' => 'Bildeintrag',
'Welcome to your b2evolution-powered website!' => 'Willkommen bei Ihrer mit b2evolution betriebenen Website!',
"<p>To get you started, the installer has automatically created several sample collections and populated them with some sample contents. Of course, this starter structure is all yours to edit. Until you do that, though, here's what you will find on this site:</p>\n\n<ul>\n<li><strong>Blog A</strong>: You are currently looking at it. It contains a few sample posts, using simple features of b2evolution.</li>\n<li><strong>Blog B</strong>: You can access it from the link at the top of the page. It contains information about more advanced features. Note that it is deliberately using a different skin from Blog A to give you an idea of what's possible.</li>\n<li><strong>Photos</strong>: This collection is an example of how you can use b2evolution to showcase photos, with photos grouped into photo albums.</li>\n<li><strong>Forums</strong>: This collection is a discussion forum (a.k.a. bulletin board) allowing your users to discuss among themselves.</li>\n<li><strong>Manual</strong>: This showcases how b2evolution can be used to publish structured content such as an online manual or book.</li>\n\n</ul>\n\n<p>You can add new collections of any type (blog, photos, forums, etc.), delete unwanted one and customize existing collections (title, sidebar, blog skin, widgets, etc.) from the admin interface.</p>" => "<p>Damit Sie beginnen können, hat der Installer automatisch mehrere Beispielsammlungen erstellt und sie mit einigen Beispielinhalten gefüllt. Natürlich können Sie diese Startstruktur nach eigenen Wünschen bearbeiten. Bis Sie dies tun, werden Sie Folgendes auf dieser Seite finden:<p>\n\n<ul>\n<li><strong>Blog A</strong>: Diesen sehen Sie gerade. Er enthält ein paar Beispieleinträge mit simplen Features von b2evolution.</li>\n<li><strong>Blog B</strong>: Auf diesen greifen Sie mit dem Link oben auf der Seite zu. Er enthält Informationen über erweiterte Features. Denken Sie daran, dass hier absichtlich ein anderer Skin als bei Blog A verwendet wird, damit Sie eine Vorstellung davon bekommen, was möglich ist.<li>\n<li><strong>Fotos</strong>: Diese Sammlung ist ein Beispiel dafür, wie Sie b2evolution benutzen können, um Fotos, die in Fotoalben zusammengeführt sind, zu präsentieren.\n<li><strong>Foren</strong>: Diese Sammlung ist ein Diskussionsforum (auch bekannt als Schwarzes Brett), die es Benutzern erlaubt miteinander zu diskutieren.<li>\n<li><strong>Anleitung</strong>: Dies ist ein Beispiel dafür, wie b2evolution verwendet werden kann, um strukturierte Inhalte, wie zum Beispiel ein Online-Handbuch oder ein Buch, zu veröffentlichen.</li>\n\n</ul>\n\n<p>Sie können Sammlungen jeder Art hinzufügen (Blogs, Fotos, Foren etc.), ungewollte löschen und bereits existierende Sammlungen im Administrationsbereich anpassen (Titel, Seitenleiste, Blog-Skin, Widgets etc.)<p>",
'b2evo skins repository' => 'b2evo Skin-Repository',
'About Blog B' => 'Über Blog B',
'Blog B' => 'Blog B',
"<p>This is the intro post for the front page of Blog B.</p>\n\n<p>Blog B is currently configured to show a front page like this one instead of directly showing the blog's posts.</p>\n\n<ul>\n<li>To view the blog's posts, click on \"News\" in the menu above.</li>\n<li>If you don't want to have such a front page, you can disable it in the Blog's settings > Features > <a %s>Front Page</a>. You can also see an example of a blog without a Front Page in Blog A</li>\n</ul>" => "<p>Dies ist der Intro-Eintrag für die Startseite von Blog B.\n\n</p> <p>Blog B ist momentan so konfiguriert, dass er eine Startseite wie diese anzeigt, anstatt direkt die Einträge des Blogs anzuzeigen.</p>\n\n<ul>\n<li>Um die Einträge des Blogs zu sehen, klicken Sie oben in dem Menü auf \"Neuigkeiten\".</li> <li>Wenn Sie so eine Startseite nicht haben möchten, können Sie sie in den Blog-Einstellungen > Features > <a %s>Startseite</a> ändern. In Blog A können Sie ein Beispiel dafür sehen, wie ein Blog ohne Startseite aussieht.</li>\n</ul>",
'Welcome to Blog B' => 'Willkommen zu Blog B',
'This uses post type "Intro-Cat" and is attached to the desired Category(ies).' => 'Dies benutzt den Eintragstyp "Intro-Kat." und ist in die gewünschte(n) Kategorie(n) eingeordnet.',
'b2evolution tips category &ndash; Sub Intro post' => 'b2evolution-Tipps-Kategorie &ndash; untergeordneter Intro-Eintrag',
'This uses post type "Intro-Tag" and is tagged with the desired Tag(s).' => 'Dies benutzt den Eintragstyp "Intro-Tag" und ist mit den gewünschten Tags versehen.',
'Widgets tag &ndash; Sub Intro post' => 'Widgets-Tag &ndash; untergeordneter Intro-Eintrag',
"<p>This is a demo of a featured post.</p>\n\n<p>It will be featured whenever we have no specific \"Intro\" post to display for the current request. To see it in action, try displaying the \"Announcements\" category.</p>\n\n<p>Also note that when the post is featured, it does not appear in the regular post flow.</p>" => "<p>Das ist ein Beispiel eines Sondereintrags.</p>\n\n<p>Er wird angezeigt, wenn wir keinen bestimmten \"Intro\"-Artikel für die aktuelle Anfrage haben. Um ein Beispiel zu sehen, versuchen Sie, die \"Ankündigungen\"-Kategorie anzuzeigen.</p>\n\n<p>Beachten Sie auch, dass Sondereinträge nicht in der normalen Artikelabfolge erscheinen.</p>",
"<p>b2evolution comes with an <code>.htaccess</code> file destined to optimize the way b2evolution is handled by your webseerver (if you are using Apache). In some circumstances, that file may not be automatically activated at setup. Please se the man page about <a %s>Tricky Stuff</a> for more information.</p>\n\n<p>For further optimization, please review the manual page about <a %s>Performance optimization</a>. Depending on your current configuration and on what your <a %s>web hosting</a> company allows you to do, you may increase the speed of b2evolution by up to a factor of 10!</p>" => "</p>b2evolution verfügt über eine <code>.htaccess</code> Datei, die dazu bestimmt ist, den Vorgang zu optimieren wie b2evolution von Ihrem Webserver gehandhabt wird (wenn Sie Apache verwenden). Unter gewissen Umständen kann es vorkommen, dass die Datei nicht gleich beim Einrichten aktiviert wird. Bitte sehen Sie sich diesbezüglich die Hauptseite über <a %s>Kniffliges Zeug</a> für mehr Informationen an.</p>\n\n</p>Für weitere Optimierung lesen Sie bitte die Handbuchseite über <a %s>Performance-Optimierung</a>. Je nachdem wie Ihre aktuelle Konfiguration ist und was Ihnen Ihre  <a %s>Web Hosting</a> Firma erlaubt, können Sie möglicherweise die Geschwindigkeit von b2evolution bis um das 10-fache erhöhen!</p>",
'Apache optimization...' => 'Apache-Optimierung...',
"<p>By default, blogs are displayed using an evoskin. (More on skins in another post.)</p>\n\n<p>This means, blogs are accessed through '<code>index.php</code>', which loads default parameters from the database and then passes on the display job to a skin.</p>\n\n<p>Alternatively, if you don't want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided '<code>a_stub.php</code>' and call your blog through this stub instead of index.php .</p>\n\n<p>Finally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided '<code>a_noskin.php</code>'.</p>\n\n<p>If you want to integrate a b2evolution blog into a complex website, you'll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.</p>\n\n<p>You will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.</p>\n\n<p>Either way, make sure you go to the blogs admin and set the correct access method/URL for your blog. Otherwise, the permalinks will not function properly.</p>" => "<p>Standardmäßig werden Blogs mit Hilfe eines evoskins angezeigt. (Mehr Informationen zu Skins gibt es in einem anderen Eintrag.)</p>\n\n<p>Das bedeutet, dass Blogs über die '<code>index.php</code>'-Datei aufgerufen werden, welche Standardparameter aus der Datenbank lädt und dann die Aufgabe des Anzeigens an einen Skin übergibt.</p>\n\n<p>Alternativ, wenn Sie nicht die Standard-DB-Parameter nutzen möchten und, sagen wir, einen Skin, eine Kategorie oder einen bestimmten Link-Blog erzwingen wollen, können Sie eine Stub-Datei wie die bereitgestellte '<code>a_stub.php</code>'-Datei erzeugen und Ihr Blog über ein Stub anstatt über index.php aufrufen.</p>\n\n<p>Wenn Sie nun letztendlich einige sehr spezielle Anpassungen an Ihrem Blog vornehmen möchten, können Sie reine Templates anstatt Skins benutzen. Rufen Sie Ihren Blog in diesem Fall über ein vollständiges Template wie die bereitgestellte '<code>a_noskin.php</code>'-Datei auf.</p>\n\n<p>Wenn Sie ein b2evolution-Blog in eine komplexe Webseite integrieren wollen, möchten Sie das möglicherweise tun, indem Sie Code aus <code>a_noskin.php</code> kopieren und in eine Seite Ihrer Webseite einfügen.</p>\n\n<p>Mehr Informationen finden Sie in den eigentlichen Stub-/Template-Dateien. Öffnen Sie sie in einem Texteditor und lesen Sie die enthaltenen Kommentare.</p>\n\n<p>Wie auch immer, stellen Sie sicher, dass Sie im Blog-Administrationsbereich die richtige Zugriffsmethode/die richtigee URL für Ihren Blog einstellen - sonst werden Permalinks nicht ordnungsgemäß funktionieren.</p>",
'Skins, Stubs, Templates &amp; website integration...' => 'Skins, Stubs, Templates &amp; Webseiten-Integration...',
"<p>b2evolution blogs are installed with a default selection of Widgets. For example, the sidebar of this blog includes widgets like a calendar, a search field, a list of categories, a list of XML feeds, etc.</p>\n\n<p>You can add, remove and reorder widgets from the Blog Settings tab in the admin interface.</p>\n\n<p>Note: in order to be displayed, widgets are placed in containers. Each container appears in a specific place in an evoskin. If you change your blog skin, the new skin may not use the same containers as the previous one. Make sure you place your widgets in containers that exist in the specific skin you are using.</p>" => "<p>In b2evolution Blogs sind bereits ein paar grundlegende Widgets installiert. Zum Beispiel enthält die Seitenleiste dieses Blogs Widgets wie einen Kalender, ein Suchfeld, eine Liste von Kategorien, eine Liste von XML Feeds etc.<p>\n\n<p>Sie können Widgets in den Blog-Einstellungen im Administrationsbereich hinzufügen, entfernen und neu anordnen.<p>\n\n<p>Hinweis: Damit Widgets angezeigt werden, werden Sie in Containern platziert. Jeder Container taucht an einem bestimmen Ort in einem Evoskin auf. Wenn Sie den Blog-Skin ändern, verwendet der neue Skin möglicherweise nicht die gleichen Container wie der vorherige. Sorgen Sie dafür, dass Ihre Widgets in Containern platziert werden, die in dem bestimmten Skin existieren, den Sie verwenden.<p>",
'About widgets...' => 'Über Widgets...',
"<p>By default, b2evolution blogs are displayed using an evoskin.</p>\n\n<p>You can change the skin used by any blog by editing the blog settings in the admin interface.</p>\n\n<p>You can download additional skins from the <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on \"Install new\".</p>\n\n<p>You can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.</p>\n\n<p>To start customizing a skin, open its \"<code>index.main.php</code>\" file in an editor and read the comments in there. Note: you can also edit skins in the \"Files\" tab of the admin interface.</p>\n\n<p>And, of course, read the <a href=\"%s\" target=\"_blank\">manual on skins</a>!</p>" => "<p>b2evolution Blogs werden standardmäßig mit einem Evoskin angezeigt.<p>\n\n<p>Sie können den Skin eines jeden Blogs ändern, indem Sie die Blog-Einstellungen im Administrationsbereich bearbeiten.<p>\n\n<p>Sie können zusätzliche Skins auf der <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">Skin-Seite</a> herunterladen. Um sie zu installieren, entpacken Sie sie in das Verzeichnis /blogs/skins und gehen Sie anschließend auf Allgemeine Einstellungen &gt; Skins im Administrationsbereich und klicken Sie auf \"Neue installieren\".</p>\n\n<p>Sie können auch Ihre eigenen Skins erstellen, indem Sie bereits existierende Skin-Ordner im Verzeichnis /blogs/skins des Blogs duplizieren, umbenennen und anpassen.<p>\n\n<p>Um mit der Anpassung eines Skins zu beginnen, öffnen Sie seine \"<code>index.main.php</code>\" Datei in einem Editor und lesen Sie dort die Kommentare. Hinweis: Sie können Skins auch im Tab \"Dateien\" des Administrationsbereich bearbeiten.\"<p>\n\n<p>Und lesen Sie natürlich das<a href=\"%s\" target=\"_blank\">Handbuch für Skins</a>!</p>",
'About skins...' => 'Über Skins...',
'About Photos' => 'Über Fotos',
'Sunset' => 'Sonnenuntergang',
'Bus Stop Ahead' => 'Bushaltestelle voraus',
"Heading\n=======\n\nSub-heading\n-----------\n\n### H3 header\n\n#### H4 header ####\n\n> Email-style angle brackets\n> are used for blockquotes.\n\n> > And, they can be nested.\n\n> ##### Headers in blockquotes\n>\n> * You can quote a list.\n> * Etc.\n\n[This is a link](http://b2evolution.net/) if Links are turned on in the markdown plugin settings\n\nParagraphs are separated by a blank line.\n\n    This is a preformatted\n    code block.\n\nText attributes *Italic*, **bold**, `monospace`.\n\nShopping list:\n\n* apples\n* oranges\n* pears\n\nThe rain---not the reign---in Spain." => "Überschrift\n=======\n\nUnter-Überschrift\n-----------\n\n### H3 Überschrift\n\n#### H4 Überschrift####\n\n> Spitze Klammern im E-Mail-Stil\n> werden für Blockzitate verwendet.\n\n> > Und sie können verschachtelt werden.\n\n> ##### Überschriften in Blockzitaten\n>\n> * Sie können eine Liste zitieren.\n> * Etc.\n\n[Dies ist ein Link](http://b2evolution.net/) wenn in den Markdown\nPlugin-Einstellungen Links eingeschaltet sind\n\nAbsätze werden durch eine leere Zeile getrennt.\n\nDies ist ein vorformatierter\nCodeblock.\n\nTextattribute *Italic*, **bold**, `monospace`.\n\nEinkaufsliste:\n\n* Äpfel\n* Orangen\n* Birnen\n\nDer Regen---nicht die Regierung---in Spanien",
'About Forums' => 'Über Foren',
"<p>This is the first topic.</p>\n\n<p>It appears in a single category.</p>" => "<p>Dies ist das erste Thema.<p>\n\n<p>Es erscheint in einer einzelnen Kategorie.<p>",
'First Topic' => 'Erstes Thema',
"<p>This is the second topic.</p>\n\n<p>It appears in multiple categories.</p>" => "<p>Dies ist das zweite Thema.<p>\n\n<p>Es erscheint in mehreren Kategorien.<p>",
'Second topic' => 'Zweites Thema',
"<p>This topic has an image attached to it. The image is automatically resized to fit the current blog skin. You can zoom in by clicking on the thumbnail.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>Diesem Thema ist ein Bild angehängt. Die Größe des Bilds wird automatisch angepasst, damit es auf den aktuellen Blog-Skin passt. Indem Sie auf den Thumbnail klicken, können Sie ranzoomen.<p>\n\n<p>Sehen Sie sich den Foto-Blog an (zugänglich über die Links oben), um einen ganz anderen Skin zu sehen, bei dem der Fokus eher auf Fotos, als auf Blog-Texten liegt.<p>",
'Image topic' => 'Bildthema',
"<p>This is page 1 of a multipage topic.</p>\n\n<blockquote><p>This is a Block Quote.</p></blockquote>\n\n<p>You can see the other pages by clicking on the links below the text.</p>" => "<p>Dies ist Seite 1 eines mehrseitigen Themas.<p>\n\n<blockquote><p>Dies ist ein Blockzitat.</p></blockquote>\n\n<p>Sie können die anderen Seiten sehen, indem Sie auf die Links unter dem Text klicken.<p>",
'This is a multipage topic' => 'Dies ist ein mehrseitiges Thema',
"<p>This is an extended topic with no teaser. This means that you won't see this teaser any more when you click the \"more\" link.</p>\n\n[teaserbreak]\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Dies ist ein erweitertes Thema ohne Teaser. Das bedeutet, dass Sie diesen Teaser nicht mehr sehen werden, wenn Sie auf den Link \"mehr\" klicken.<p>\n\n[teaserbreak]\n\n<p>Dies ist ein erweiterter Text. Sie sehen ihn nur, wenn Sie auf den Link \"mehr\" geklickt haben.<p>",
'Extended topic with no teaser' => 'Erweitertes Thema ohne Teaser',
"<p>This is an extended topic. This means you only see this small teaser by default and you must click on the link below to see more.</p>\n\n[teaserbreak]\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Dies ist ein erweitertes Thema. Das bedeutet, dass Sie standardmäßig nur diesen kleinen Teaser sehen. Um mehr zu sehen, müssen Sie auf den Link unten klicken.<p>\n\n[teaserbreak]\n\n<p>Dies ist ein erweiterter Text. Sie sehen diesen nur, wenn Sie auf den Link \"mehr\" geklickt haben.<p>",
'Extended topic' => 'Erweitertes Thema',
'Markdown examples' => 'Markdown Beispiele',
